import React from 'react';
import logo from '../images/Sphera RO.png';
import '../styles/App.css';


function App() {
  return (
    <div className="App">
      <div className="header">
        <div className="wrap">
            <a href="https://www.sitehawk.com/" target="_blank"><img src={logo} className="logo" /></a>
        </div>
      </div>
    </div>  
  );
}

export default App;
